import React from "react";
import { ProfileCard } from "./Components/card";
import { 
    MDBCard,
    MDBCardBody,
    MDBContainer,
    MDBRow,
    MDBCol,
 } from "mdb-react-ui-kit";
 import "./style.css";
import { TableSection } from "./Components/tableSection";
export function Trello() {

    const dataForDream = [
        <ProfileCard countryName="United State Of America" cardPicUrl={""} />,
        <ProfileCard countryName="Neterland" cardPicUrl={""}/>,
        <ProfileCard countryName="United State Of America" cardPicUrl={""}/>
    ]
    const dataForBest = [
        <ProfileCard countryName="United State Of America" cardPicUrl={""} />,
        <ProfileCard countryName="United State Of America" cardPicUrl={""}/>,
        <ProfileCard countryName="United State Of America" cardPicUrl={""}/>
    ]
    const dataForGood = [
        <ProfileCard countryName="United State Of America" cardPicUrl={""} />,
        <ProfileCard countryName="United State Of America" cardPicUrl={""}/>,
        <ProfileCard countryName="United State Of America" cardPicUrl={""}/>
    ]
    const dataForIntermediate = [
        <ProfileCard countryName="United State Of America" cardPicUrl={""} />,
        <ProfileCard countryName="United State Of America" cardPicUrl={""}/>,
        <ProfileCard countryName="United State Of America" cardPicUrl={""}/>
    ]
    const dataForEvil = [
        <ProfileCard countryName="United State Of America" cardPicUrl={""} />,
        <ProfileCard countryName="United State Of America" cardPicUrl={""}/>,
        <ProfileCard countryName="United State Of America" cardPicUrl={""}/>
    ]


    const trello = {
       first: ["Dream", "Best", "Good", "Intermediate", "Evil"],
       second : [dataForDream, dataForBest]
    }





    return(
        <>  
            <div className="trello-container">
                <MDBRow className="trello-content">
                    {
                        trello.first.map((titles, i) => {
                            return (
                                <MDBCol key={i} >
                                    <TableSection tableTitle={titles} data={trello.second[i]}></TableSection>
                                </MDBCol>
                            )
                        })
                    }
                </MDBRow>
            </div>
        </>



    )
}
